import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './pages/Home';
import Sidebar from './Sidebar';

function App() {
  return (
    <div>
      <Sidebar />
      <BrowserRouter>
        <Routes>
          <Route path="/home" element={<Home />}>
            <Route index element={<Home />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
